import React from "react";

const AddTask = () => {
  return (
    <form action="">
      <div className="form-control">
        <label>Task</label>
        <input type="text" placeholder="Add Task" />
      </div>
      <div className="form-control">
        <label>Day and Time</label>
        <input type="text" placeholder="Add Day or Time" />
      </div>
      <div className="form-control">
        <label>Set Reminder</label>
        <input type="checkbox" />
      </div>
    </form>
  );
};

export default AddTask;
